import React from "react";
import { FaTruck } from "react-icons/fa";
import { FaCreditCard } from "react-icons/fa";
import { FaPhoneAlt } from "react-icons/fa";
import LogoImg from "./../../assets/images/Logo.png";

const Header = () => {
  return (
    <header className="">
      <div className="bg-gray-900 p-4  mx-auto flex justify-around items-center ">
        <div className=" text-white hidden lg:flex lg:justify-center lg:items-center">
          <FaTruck className="mr-2" />
          <p>free shipping</p>
        </div>

        <div className="text-white hidden lg:flex lg:justify-center lg:items-center ">
          <FaCreditCard className="mr-2" />
          <p>e-dinar</p>
        </div>

        <div className="text-white flex justify-center items-center">
          <FaPhoneAlt className="mr-2" />
          <p>Need advice? Call us 22 999 000</p>
        </div>
      </div>

      <div className="">
        <div className="">
          <img src={LogoImg} alt="logo" />
          <form action="">
            <input type="text" placeholder="Search for a product..." />
            <button className="capitalize">search</button>
          </form>
        </div>
      </div>

      <hr />
    </header>
  );
};

export default Header;
